import React from 'react';
import TodoElement from '../common/components/todo/TodoElement';

const HomePageContainer = () => (
  <>
    <div>React is ready HOME!</div>
    <table>
      <tr>
        <th>Todo Title</th>
        <th>Description</th>
        <th>Actions</th>
      </tr>
      <TodoElement />
    </table>
  </>
);

export default HomePageContainer;
